import React from "react";
import "./Main.scss";
export default function Main() {
  return (
    <div className="section1">
      <div className="container">
        <div className="main_section">
          {/* div-1 */}
          <div className="heading">
            <span>
              A joint venture by TimberBox Renovations Inc. and EVT Capital Inc
            </span>
          </div>
          {/* div-2 */}
          <div className="imagedescription">
            {/* div-1 */}
            <div className="h_image">
              <img className="heading_image" src="/Images/1.jpg" />
            </div>
            {/* div-2 */}
            <div className="description">
              <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Eum,
                fugit. Quia tempora dolores id reiciendis, aperiam facilis odio
                ipsam consequuntur voluptates suscipit dignissimos, obcaecati
                odit officia aliquid in perferendis delectus
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
